import './App.css';
import Homepage from './pages/homepage/homepage.component';
import {Route, Routes, BrowserRouter, useParams} from 'react-router-dom';


function App() {
  return (
    <div>
    {/* <Homepage /> */}
    <BrowserRouter>
    <Routes>
    <Route path="/" element={<Homepage />}/>
    </Routes>
    </BrowserRouter>
    </div>
  )
}

export default App;
